import React from "react";
import ProgressBar from "react-bootstrap/ProgressBar";


function SkillsBar({ python, value, isScrolled }) {

  return (
    <div style={{ width: "95%" }}>
      <p className="lead mb-1 mt-2">{python,python,python,python,python,python,python,python,python,python,python,python}</p>
      <ProgressBar
        className={!isScrolled ? "progress" : " progress-bar-animation"}
        now={value}
      />
    </div>
  );
}

export default SkillsBar;
